INSERT INTO `Events` (`Date_Time`, `Name`, `Place`, `Details`, `EventID`, `Photo`) VALUES
('2015-10-27 22:00:00', 'Halloween Party @ Qube Club', 'Qube Boutique Bar + Club ', 'Essex Cypriot Society and Hellenic Society\r\n\r\nPRESENT\r\n\r\nThe Annual Halloween Party\r\n\r\nThe night of the doom has arrived! Prepare yourselves for an atmosphere full of fear, scary scenery and panic! Dress up and come to Qube Club for an unforgettable entertainment experience with masks and capes! Bring your Halloween mood and dance on the bloody vibes of Al3k DJ and Airborne.\r\n\r\nBest Costume WINS a free entry in one of the next Greek Nights\r\n\r\nEntry: £8\r\nMember Entry: £4\r\n\r\nDoors Open: 22:00\r\nLast Entry: 00:30 (Stricltly)', 8, );
