INSERT INTO `Events` (`Date_Time`, `Name`, `Place`, `Details`, `EventID`, `Photo`) VALUES
('2015-11-24 17:00:00', 'CYPRUS PROBLEM', 'Room: LTB 8', '‘Το Κυπριακό Πρόβλημα’\nΠροτεινόμενα σημεία γύρω από τα οποία μπορεί να περιστραφεί η συζήτηση:\n1. Είναι η Διζωνική Δικοινοτική Ομοσπονδία η πιο ενδεδειγμένη μορφή λύσης για την πατρίδα μας;Αν όχι, ποια άλλη θα ήταν ιδανικότερη;\n2. Είναι εφικτή η ειρηνική συνύπαρξη με τους Τουρκοκύπριους;\n3. Ποια τα αίτια και ποιοι οι αίτιοι της διαίρεσης της πατρίδας μας; Πρέπει όσοι βρίσκονται ακόμη εν ζωή να τιμωρηθούν παραδειγματικά, παρά την παρέλευση 41 χρόνων από την τουρκική εισβολή;\n4. Συμφωνείτε με την ιδέα της εκ περιτροπής προεδρίας και της σταθμισμένης ψήφου;\n\nP.S If there are any non Greek speaker in the room the debate must proceed in English.\n\nHope to see you all there.', 9, );
