('2015-12-04 16:00:00', 'Societies Guild Winter Fayre 2015', 'University of Essex, Wive', 'It''s that time of year when you need to put on your snuggly jumpers, hats and scarves and come to the Societies Guild Winter Fayre! With societies stalls hosting games and yummy food, fantastic performances and delicious hot food and drinks it''s the perfect way to get into the festive spirit. They''ll also be a photobooth, santa''s grotto and more. See you there!', 10, );

